import React from 'react';
import PostFeed from '../components/Feed/PostFeed';

const Home = () => {
    return (
        <div className="container mx-auto p-4">
            <h1 className="text-2xl font-bold mb-4">Home</h1>
            <PostFeed />
        </div>
    );
};

export default Home;
